import styles from './MilkList.module.css'

const MILK_LIST = [
    {
      id: "m1",
      name: 'XS Milk"',
      description:
        "500ml",
      price: 2.99,
    },
    {
      id: "m2",
      name: "S Milk",
      description: "700ml",
      price: 3.99,
    },
    {
      id: "m3",
      name: "M Milk",
      description: "1300ml",
      price: 5.99,
    },
    {
      id: "m4",
      name: "L Milk",
      description:
        "1900ml",
      price: 7.99,
    },
  ];

export const MilkList = () => {

    const milkList = MILK_LIST.map(milk => <li key={MILK_LIST.id}>{milk.name}</li>)

    return <section className={styles.milk}>
        <ul>
            {milkList}
        </ul>
    </section>
}
